CREATE TABLE gg_place (
	place_id INTEGER PRIMARY KEY,
	place_name TEXT,
	place_coordinate_lat REAL,
	place_coordinate_lon REAL,
	place_count INTEGER,
	place_type TEXT /* enum: currentlocation, poi, station, address */
);

CREATE TABLE gg_favorite (
	favorite_id INTEGER PRIMARY KEY,
	from_id INTEGER,
	to_id INTEGER,
	favorite_name TEXT
);

CREATE TABLE gg_recent (
	recent_id INTEGER PRIMARY KEY,
	from_id INTEGER,
	to_id INTEGER,
	recent_traveldatetime TEXT,
	recent_travelmode INTEGER,
	recent_journeydata TEXT
);


CREATE INDEX gg_place_name_index ON gg_place (place_name);
